import { type } from "os";
import { LOAD_POST, PostsDispatch, PostType } from "../actions/types";

export const postsReducer = (
  state: Array<PostType> | Array<void> = [],
  action: PostsDispatch
) => {
  switch (action.type) {
    case LOAD_POST:
    default:
      return state;
  }
};
